import { Avatar, Button, Space, Table, Typography } from "antd";
import React, { useState, useEffect } from "react";
import { getAllProducts } from "../../utils/APIRoutes";
import { EditOutlined, DeleteOutlined } from '@ant-design/icons'
export default function DichVu() {
    const [loading, setLoading] = useState(false)
    const [dataSource, setDataSource] = useState([])

    useEffect(() => {
        setLoading(true);
        getAllProducts().then((res) => {
            setDataSource(res.products);
        });
    }, []);

    const onAddService = () => {
        const newService = {
            serviceId: "serviceId",
            serviceName: "serviceName",
            serviceContent: "serviceContent",
            time: "time",
            price: "price",
        };
        setDataSource = ((pre) => {
            return [...pre, newService];
        });
    };
    return (
        <div>
            <Space size={20} direction={"vertical"}>

                <Typography.Title level={4}>Dịch vụ</Typography.Title>
                <Button onClick={onAddService}>Thêm</Button>
                <Table columns={[
                    {
                        key: "1",
                        title: "Id",
                        dataIndex: "id",
                    },
                    {
                        key: "2",
                        title: "Thumbnail",
                        dataIndex: "thumbnail",
                        render: (link) => {
                            return <Avatar src={link}></Avatar>
                        }
                    },
                    {
                        key: "3",
                        title: "Title",
                        dataIndex: "title",
                    },
                    {
                        key: "4",
                        title: "Price",
                        dataIndex: "price",
                    },
                    {
                        key: "5",
                        title: "Brand",
                        dataIndex: "brand",
                    },
                    {
                        key: "6",
                        title: "Stock",
                        dataIndex: "stock",
                    },
                    {
                        key: "7",
                        title: "Category",
                        dataIndex: "category",
                    },
                    {
                        key: "8",
                        title: "Actions",
                        render: (record) => {
                            return (
                                <>
                                    <EditOutlined />
                                    <DeleteOutlined style={{ color: "red", marginLeft: "12" }} />
                                </>
                            )
                        }
                    },
                ]}
                    dataSource={dataSource}
                    pagination={
                        {
                            pageSize: 10,
                        }
                    }
                ></Table>
            </Space>
        </div>
    )
}
